import React, { Component } from "react";
import "./Navi.css";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import {faCoffee,faUser} from '@fortawesome/free-solid-svg-icons'
import { AiOutlineUser,AiOutlineHeart,AiOutlineShoppingCart } from 'react-icons/ai';

export default class Navi extends Component {
  render() {
    return (
      <div>
        <h1></h1>
        <div class="navbar">
          <a class="logo" href="#">Trendyol</a>
          <div class="wrapper">
            <div class="search_box">
              <input type="text" placeholder="Aradığınız ürün, kategori veya markayı yazınız"/>
              <i class="search-icon"></i>
            </div>
          </div>
          <ul class="nav">
            <li><a href="#"><i class ="icon"><AiOutlineUser/></i>Hesabim</a></li>
            <li><a href="#"><i class ="icon"><AiOutlineHeart/></i>Favorilerim</a></li>
            <li><a href="#"><i class ="icon"><AiOutlineShoppingCart/></i>Sepetim</a></li>
            
          </ul>
        </div>
      </div>
    );
  }
}
